Information
------------------------------

Doomsday Preppers 
Doomsday Preppers explores the lives of otherwise ordinary Americans who are preparing for the end of the world as we know it. Unique in their beliefs, motivations, and strategies, preppers will go to whatever lengths they can to make sure they are prepared for any of life's uncertainties. And with our expert's assessment, they will find out their chances of survival if their worst fears become a reality.



9)  Close the Door Load the Shotgun 
Calamity Janet welcomes you to her Armageddon Inn. Prepper Janet Spencer prepared her home for a nuclear war, and is inviting people to bunker down with her. She has spaghetti pasta to feed 1000 people. Retired photojournalist Jack Jobe started prepping in 2010, after watching the news surrounding Haitis devastating earthquake. Now Jack is prepping for the scenario he fears most a solar flare.



